window.bookSummaryJSON = "<p>This collection includes books seven to nine of the Star-Crossed Alien Mail Order Brides series: <i>Karos</i>, <i>Jet</i>, and <i>Vykor</i>. Join these three alien males as they go in search of love on the far side of the galaxy, on a primitive planet the resident lifeforms call Earth.</p> <p>Looking for love on all the wrong planets? Try the Star-Crossed Dating Agency.</p> <p><b><i>Karos</i></b></p> <p>Karos might have survived the war on Romak, but it left scars on his body and his heart.</p> <p>Now, he’s on Earth, assigned to guard the first alien embassy. His purpose is simple - protect his new home and everyone in it. This time, he won’t fail in his mission. </p> <p>This book contains a bodyguard who can kick ass in high heels and a war-weary dragon who is about to learn that love is the only battle you have to surrender to win.</p> <p><b><i>Jet</i></b> </p> <p>As the first Pyrosian ambassador to Earth, Jet has his hands - and his schedule - full.</p> <p>With protesters at the gate, VIPs on the way, and the population of an entire planet to win over, he’s got no time for distractions...like getting kidnapped.</p> <p>This book contains an heiress who puts everyone’s needs ahead of her own and a diplomat who has never been in a situation he can’t talk his way out of...until now.</p> <p><b><i>Vykor</i></b></p> <p>Born without a dragon’s spirit, Vykor has no magic, no clan, and no reason to stay on his home planet of Romak.</p> <p>He’s come to Earth to research old legends and, maybe, even find acceptance.</p> <p>This book contains an executive assistant in need of assistance and a researcher who is about to discover that love doesn’t come with instructions. </p>"; 
